import React from 'react'

export default function LangCards() {
  return (
    <div>
        <div class="card" >
          <div className='limg'><img src={hindi} class="card-img-top" alt="..."/></div>
          <div class="card-body">
            <h5 class="card-text">Hindi</h5>
          </div>
        </div>
    </div>
  )
}
